import React, { useState, useEffect, Component } from "react";
import Favicon from "react-favicon";
import "../AccountsAsset/dash.css";
import { Route, Switch, useHistory, Redirect, NavLink } from "react-router-dom";
import Sidebar from "../Component/Sidebar";
import Moment from "react-moment";
import "moment-timezone";
import TradingViewWidget, { Themes } from "react-tradingview-widget";
import { message } from "antd";
import { Modal, Button,Tag } from "antd";
import VerifyDocModal from "../Component/VerifyModal";
import Router from "../Component/Router";
import { Container, Card, Form, Row, Col, Table } from "react-bootstrap";
import WithdrawDetailsModal from "../Component/WithdrawDetailsInfoPopOver";
import VerifyDetailsPopOver from "../Component/VerifyDetailsPopOver";
import PaymentDetailsPopOver from "../Component/PaymentDetailsPopOver";
import { NavbarCo } from "../Component/Nav";
import axios from "axios"
import { DatePicker, Space } from 'antd';
import EditAutoCopyTrade from "../Component/EditCopyTrade"

class Manager extends Component {
  constructor(props) {
    super(props);
    this.state = {
      user: this.props.user,
      redirect: "/",
      data: {},
      orders: [],
      disA1: true,
      disA2: true,
      btcP: [],
      market: false,
      board: false,
      port: false,
      manager: true,
      levIsh: false,
      admin: false,
      allUsers: [],
      allVerify: [],
      allDeposit: [],
      allWithdraw: [],
      allBankTransfor: [],
      allTrades: [],
      userId: {},
      displayC: false,
      curDeposit: [],
      card: true,
      bal: false,
      execution: false,
      payments: false,
      secu: false,
      with: false,
      numVerified: 0,
      orderT: false,
      updateAmount: "",
      text: "Save",
      decline: false,
      autoTrade: false,
      declinedMessage: "",
      yourName: "",
      yourEmailAddress: "",
      yourLanguage: "",
      yourCurrency: "",
      userLevel: "",
      yourWallet: 0,
      editProfile: false,
      checkDate:false,
      submitAutoCopyTradeLoading:false,
      userAutoCopyTradedata:[],

      profit:null,
      Loss:null,
      _userId:"",
      market: "",
      amount:0,
      assets:"",
      scheduledTime:""
    };

    this.myRef3 = this.props.user.user ? React.createRef() : "";
    this.textInput = this.props.user.user ? React.createRef() : "";
  }

  token = "pk_135c1daf1b8d4130b9318fd5e8ab0e5e";
  fav = document.getElementById("favicon");
  title = document.getElementById("title");
  // state = {
  //   loading: false,
  //   visible: false,
  // };
onChangeDate=(value, dateString)=> {
    console.log('Selected Time');
    this.setState({checkDate:false})
    // console.log('Formatted Selected Time: ', dateString);

  }
  onOkDate=(value)=> {
    this.setState({scheduledTime:value._d})
  }
  callBackAutoTrade=(_id)=>{
    (async () => {
      let res = await fetch(
        `https://bridgegatebackend.herokuapp.com/api/autocopytrade/${_id}`
      );
      let _data = await res.json();
      this.setState({userAutoCopyTradedata:_data})
      console.log(_id)
      console.log(_data)
      // console.log({dataauto:data})
      // this.setState({
      //   userAutoCopyTradedata: data,
      // });
    })();
  }
  deleteAutoCopyTrade=(id, _userId)=>{
    axios.delete(`https://bridgegatebackend.herokuapp.com/api/autocopytrade/${id}`)
    .then((response) => {
   this.callBackAutoTrade(_userId)
         message.success("successfully deleted auto-trade")

    }, (error) => {
      console.log(error);
      message.error("error deleting auto-trade")
    });

  }
  submitAutoCopyTrade=(_id)=>{
    this.setState({submitAutoCopyTradeLoading:true})
    let payload={
       profitLoss:this.state.profit,
         userId:_id,
         market: this.state.market,
         amount:this.state.amount,
         assets:this.state.assets,
         scheduledTime:this.state.scheduledTime
    }
         axios.post('https://bridgegatebackend.herokuapp.com/api/autocopytrade', payload)
        .then((response) => {
        //  console.log(_id)
        this.callBackAutoTrade(this.state.userId._id)
          this.setState({profitLoss:null,
            market:"",
             amount:"",
            assets:"",
          scheduledTime:"",
          submitAutoCopyTradeLoading:false})
             message.success("successfully added auto-trade")

        }, (error) => {
          console.log(error);
          message.error("error adding auto-trade")
          this.setState({submitAutoCopyTradeLoading:false})
        });
    }


  setDeclinedMessage = (e) => {
    this.setState({ declinedMessage: e.target.value });
  };
  showDeclineIdentity = () => {
    this.setState({
      decline: true,
    });
  };

  closeDeclineIdentity = () => {
    this.setState({
      decline: false,
    });
  };

  setCard = () => {
    this.setState({
      card: true,
      bal: false,
      execution: false,
      payments: false,
      secu: false,
      with: false,
      orderT: false,
    });

    (async () => {
      let response = await fetch(
        `https://bridgegatebackend.herokuapp.com/api/trade/desposit${
          this.state.userId ? this.state.userId._id : ""
        }`
      );
      let data = await response.json();
      this.setState({
        curDeposit: data,
      });
    })();
  };

  setWith = () => {
    this.setState({
      card: false,
      bal: false,
      execution: false,
      payments: false,
      secu: false,
      with: true,
      orderT: false,
    });
  };
  setName = (e) => {
    // this.setState({ yourName: e })
    console.log(e);
  };
  setBal = () => {
    this.setState({
      card: false,
      bal: true,
      execution: false,
      payments: false,
      secu: false,
      with: false,
      orderT: false,
    });
  };

  setSe = () => {
    this.setState({
      card: false,
      bal: false,
      execution: false,
      payments: false,
      secu: true,
      with: false,
      orderT: false,
    });
  };

  setOrder = () => {
    this.setState({
      card: false,
      bal: false,
      execution: false,
      payments: false,
      secu: false,
      with: false,
      orderT: true,
    });
  };

  setExecution = () => {
    this.setState({
      card: false,
      bal: false,
      execution: true,
      payments: false,
      secu: false,
      with: false,
      orderT: false,
    });
  };

  setPay = () => {
    this.setState({
      card: false,
      bal: false,
      execution: false,
      payments: true,
      secu: false,
      with: false,
      orderT: false,
    });
  };

  updateAmount = (e) => {
    e.preventDefault();

    this.setState({ text: "Updating..." });

    fetch(
      `https://bridgegatebackend.herokuapp.com/api/trade/userWallet/${
        this.state.userId ? this.state.userId._id : ""
      }`,
      {
        mode: "cors",
        method: "POST",
        headers: {
          Accept: "application/json",
          "Content-Type": "application/json",
        },
        body: JSON.stringify(this.state.amount),
      }
    )
      .then(function (res) {
        return res.json();
      })
      .then((data) => {
        //  console.log(data,'hmmm')
        (async () => {
          let response = await fetch(
            `https://bridgegatebackend.herokuapp.com/api/trade/user/${this.state.user.user.user._id}`
          );
          let user = await response.json();
          this.setState({
            user: user,
          });

          let a = { user: user };
          localStorage.setItem("user", JSON.stringify(a));
        })();

        (async () => {
          let response = await fetch(
            `https://bridgegatebackend.herokuapp.com/api/trade/user/${this.state.userId._id}`
          );
          let userId = await response.json();
          this.setState({
            yourWallet: userId.user.user.wallet,
          });
        })();

        if (data) {
          this.setState({
            displayC: false,
          });
          this.setState({ text: "Save" });
        } else {
        }
      });
  };
